import React from "react";
import "../styles/EducationAlt.css";

const Education = () => {
  const educationData = [
    {
      degree: "B.Tech in Electronics and Communication Engineering",
      institution: "Malaviya National Institute of Technology, Jaipur",
      year: "2020 - 2024",
      details: [
        "CGPA: 8.02/10",
        "Relevant Courses: DSA, Operating Systems, Microprocessors and Computer Architecture"
      ]
    },
    {
      degree: "Senior Secondary (12th Grade)",
      institution: "Matrix High School, Sikar, Rajasthan",
      year: "2018 - 2020",
      details: [
        "Percentage: 87.20% (PCM)",
        "Board: Rajasthan Board of Secondary Education"
      ]
    },
    {
      degree: "Secondary (10th Grade)",
      institution: "HDI Public School, Sikar, Rajasthan",
      year: "2018",
      details: [
        "Percentage: 86.5%",
        "Board: Rajasthan Board of Secondary Education"
      ]
    }
  ];

  return (
    <section className="education-alt" id="education">
      <div className="edu-alt-header">
        <h2>Academic Journey</h2>
        <p>My educational background and achievements</p>
      </div>
      
      <div className="edu-alt-timeline">
        {educationData.map((edu, index) => (
          <div className="edu-alt-card" key={index}>
            <div className="edu-alt-dot"></div>
            <div className="edu-alt-content">
              <span className="edu-alt-year">{edu.year}</span>
              <h3>{edu.degree}</h3>
              <h4>{edu.institution}</h4>
              <ul>
                {edu.details.map((detail, i) => (
                  <li key={i}>{detail}</li>
                ))}
              </ul>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Education;
